import React, { Component } from 'react';
import { connect } from 'react-redux'
import { addCategory, editCategory } from '../../actions/category'
import './CategoryEdit.css'

class CategoryEdit extends Component {
  state = {
    description: '',
    color: ''
  }

  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          <div>
            <label> Description: </label>
            <input type="text"></input>
            <div id="color_container">
              <div id="color_1"> Color </div>
              <div id="color_2"> Color </div>
              <div id="color_3"> Color </div>
              <div id="color_4"> Color </div>
              <div id="color_5"> Color </div>
              <div id="color_6"> Color </div>
              <div id="color_7"> Color </div>
              <div id="color_8"> Color </div>
              <div id="color_9"> Color </div>
            </div>
            <div>
              <button> Save </button>
            </div>
          </div>
        </form>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    category: state.categoryReducer.category
  }
}

const mapDispatchToProps = dispatch => {
  return {
    category: category => category(category, dispatch)
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(CategoryEdit)
